/**@type {HTMLCanvasElement} */
const canvas = document.getElementById('canvas1');
const ctx = canvas1.getContext('2d');
canvas.width = 800;
canvas.height = 450;

const image1 = new Image();

// image1.src = 'spiderman.png';
// some browser deney canvas due to cross-origin-content. In that case
// we can use below base 64 version of your image insted of loading your image.
// or you can use toDarURL(), a built in javascript function
image1.src =
	'data:image/png;base64,';

image1.addEventListener('load', function () {
	ctx.drawImage(image1, 200, 0, canvas.width / 2, canvas.height);
	// Gets the pixel data from a particular area in the canvas
	const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
	// copies the UintClampedarray data from image.
	const scannedData = scannedImage.data;
	// console.log(scannedData);
	// here we are going to make a gray scale image from given image
	// gray scale image works by taking the average of all 3 colors and
	// applying the same amount to each color
	// rgb(50,50,50), rgb(120,120,120), rgb(200,200,200)
	// depends up on the value image get darker or lighter
	// we increment 4 on each loop because each pixel contains 4 values
	// red, green, blue, alpha - rgba(0,0,0,0.5).
	// These values stored each index seperately
	for (i = 0; i < scannedData.length; i += 4) {
		// adding the values of red, blue and green. alpha value not added.
		const totalColorValue = scannedData[i] + scannedData[i + 1] + scannedData[i + 2];
		const averageColorValue = totalColorValue / 3;
		// replacing the original pixel color value with gray scale value
		scannedData[i] = averageColorValue;
		scannedData[i + 1] = averageColorValue;
		scannedData[i + 2] = averageColorValue;
	}
	scannedImage.data = scannedData;
	ctx.putImageData(scannedImage, 0, 0);
});
